import Navbar from "react-bootstrap/Navbar";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
export default function Header() {
  return (
    <Navbar expand="lg">
      <Navbar.Brand>
        <FontAwesomeIcon icon="fa-solid fa-teddy-bear" />
      </Navbar.Brand>
    </Navbar>
  );
}
